import React from 'react';

import UserItem from '../UserItem/UserItem';
import Card from '../Card/Card';

const UserList = (props) => {
    return (
        <ul>
            {props.users.map((users) => (
                
                <UserItem
                    key={users.id}
                    id={users.id}
                    name={users.name}
                    age={users.age}
                />
            ))}
        </ul>
    );
}

export default UserList;
